import React, { useState, useEffect } from 'react';

function Orszag() {
  const [countries, setCountries] = useState([]);

  useEffect(() => {
    fetch('./orszag.json')
      .then((response) => {
        if (!response.ok) {
          throw new Error('Hiba történt a fetchelés során');
        }
        return response.json();
      })
      .then((data) => {
        setCountries(data.orszagok);
      })
      .catch((error) => {
        console.error('Hiba történt a fetchelés során:', error);
      });
  }, []);

  return (
    <div>
      <h2>Országok</h2>
      <ul>
        {countries.map((country, index) => (
          <li key={index}>
            <h3>{country.orszag}</h3>
            <p>{country.leiras}</p>
            <img src={country.kep} alt={country.orszag} />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Orszag;
